import React, { useState, useEffect } from 'react';

// Sample data of 20 workers
const initialWorkers = Array.from({ length: 20 }, (_, i) => ({
  id: i + 1,
  name: `Worker ${i + 1}`,
  location: `Location ${i + 1}`,
  experience: `${(i % 10) + 1} years`,
  available: true,
}));

export default function Workers() {
  return <h1>Workers Page Loaded</h1>;
}
